import React, { Component } from 'react'

class Todos extends Component {
  state = {
    todos: [
      {
        id: 1,
        title: 'Brush Teeth',
        isCompleted: false
      }
    ]
  };

  render() {
    const { todos } = this.state;
    return (
      <div className='todos'>
        {todos && todos.map(todo => {
          return <p>{todo.title}</p>
        })}
      </div>
    )
  }
};

export default Todos;
